// SPDX-License-Identifier: MIT OR LGPL-2.0-or-later
pragma solidity ^0.8.5;

import "./ERC20Token.sol";
import "./Operations.sol";
import "./ExternalStorage.sol"; 

contract Getters is ExternalStorage {

    ERC20Token internal token;
    Operations internal operation;

    constructor(address _tokenAddress, address _opAddress)
    {
        token = ERC20Token(_tokenAddress);
        operation = Operations(_opAddress);
    }

    /*
     * Gets Passengers Details
     */
    function getPassengerFlightDetail(
        address _flightEscrow,
        address _passenger,
        uint256  _keyId
    )
    public
    view
    returns (PassengerBookingDetails memory)
    {
      PassengerBookingDetails memory arrayPassenger = flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId];
    return (arrayPassenger);
    }

    /*
     * Flight escrow detail
     */
    function getEscrowDetails(
        Escrow _flightEscrow
    )
    public
    view
    returns(
        EscrowDetails memory){
        return _flightEscrow.getAirline();
    }

    /*
     * Total amount in created Escrow
     */
    function getEscrowTotal(
        Escrow _flightEscrow
    )
    public
    view
    returns(uint256){

        return token.balanceOf(address(_flightEscrow));
    }

    /*
     * Get total passengers in escrow
     */
    function getEscrowPassengerCount(
        Escrow _flightEscrow,
        address _passenger
    )
    public
    view
    returns(uint256){

        return flightPassengers[address(_flightEscrow)].passengers[_passenger].length;
    }

    /*
     * Amount paid by passenger for escrow
     */
    function getPassenger(
        Escrow _flightEscrow,
        address _passenger,
        uint256 _keyId
        )
        public
        view
        returns(PassengerBookingDetails memory){

            return operation.PassengerManifest(address(_flightEscrow), _passenger, _keyId);
        }

    /*
     * Get total token claimed by Passengers from Escrow
     */
    function getEscrowTotalClaimed(
        address _flightEscrow
        )
        public
        view
     returns(uint256, uint256){

        return (PassengerClaim[_flightEscrow].TotalAmountClaimed, PassengerClaim[_flightEscrow].NumberOfPassengers);
    }

    /*
     * Get claimable booking fee
     */
    function claimableBookingRefund(
        Escrow _flightEscrow,
        address _passenger,
        uint256 _keyId
    )
    public
    view
    returns(uint256, PassengerBookingDetails memory){
        uint256 CLAIMABLE_AMOUNT = token.allowance(address(_flightEscrow), _passenger);

        return (CLAIMABLE_AMOUNT, operation.PassengerManifest(address(_flightEscrow), _passenger, _keyId));
    }

    /*
     * Get Escrow balance
    */
    function getEscrowBalance(
        Escrow _flightEscrow
        )
        public
        view
        returns (uint256){

        return token.balanceOf(address(_flightEscrow));
    }
}
